import * as React from "react";
import { AppData } from "./appdata";
import Aside from "./aside";
import Footer from "./footer";
import Primary from "./primary";

const Main = () => {
  let { state, dispatch } = React.useContext(AppData);
  return (
    <React.Fragment>
      <Aside />
      <div className="main-content">
        <Primary />
      </div>
      <Footer />
    </React.Fragment>
  );
};

export default Main;
